/**
 * International Space Station Position Animation
 * ----------------------------------------------
 * This script fetches the ISS latitude/longitude every 5 seconds
 * and moves the red circle (element with ID="ISS") on an equirectangular map.
 *
 * Equirectangular projection:
 *   - Longitude -180 ‚Üí +180 maps to x = 0 ‚Üí 1000
 *   - Latitude   +90 ‚Üí -90 maps to y = 0 ‚Üí 500
 *
 * Your SVG is 1000√ó500, so the math is straightforward.
 */

async function updateISS() {
  //console.log("Updating ISS...", new Date().toLocaleTimeString());

  try {
    // 1. Fetch ISS data
  //  const response = await fetch("https://api.open-notify.org/iss-now.json");

      const response = await fetch('https://corsproxy.io/?http://api.open-notify.org/iss-now.json');
    const data = await response.json();

    if (!data || !data.iss_position) {
      console.error("ISS data missing", data);
      return;
    }

    // 2. Extract latitude and longitude as numbers
    const lat = parseFloat(data.iss_position.latitude);
    const lon = parseFloat(data.iss_position.longitude);

    // 3. Convert lat/long ‚Üí x/y
    // Longitude: -180 ‚Üí +180  maps to 0 ‚Üí 1000
    const x = ((lon + 180) / 360) * 1000;

    // Latitude: +90 ‚Üí -90 maps to 0 ‚Üí 500 (note the flip!)
    const y = ((90 - lat) / 180) * 500;

    // 4. Get the ISS SVG element
    const iss = document.getElementById('ISS-ISS-Map-5-simplified-styles-interactive-chatGPT-fixed-d39eo0');

    if (!iss) {
      console.error("Element with ID 'ISS' not found.");
      return;
    }

    /**
     * 5. Move the ISS marker
     * We don't know whether ISS is a <circle> with cx/cy
     * or a <g> group. So we check and choose the right method.
     */

    if (iss.tagName.toLowerCase() === "circle") {
      // If it is a circle, update cx/cy
      iss.setAttribute("cx", x);
      iss.setAttribute("cy", y);
    } else {
      // If it is a <g> or another element, use transform translate
      iss.setAttribute("transform", `translate(${x}, ${y})`);
    }

   // console.log(
   //   `ISS updated ‚Üí lat:${lat.toFixed(2)} lon:${lon.toFixed(2)} ‚Üí x:${x.toFixed(2)} y:${y.toFixed(2)}`,
   //   new Date().toLocaleTimeString()
   // );

  } catch (error) {
    console.error("Failed to update ISS:", error);
  }
}

// Run immediately once
updateISS();

// Update every 5 seconds
setInterval(updateISS, 5000);



